script: |
  super -f text -I q3632.spq | sort > q3632.out

inputs:
  - name: q3632.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE NOT col2 * col0 BETWEEN col1 / - - 97 + + + 63 - - - col0 * - 88 * - + col0 + col2 AND NULL;
  - name: tab2

outputs:
  - name: q3632.out
    data: |
